import React, {Component} from 'react';
// import ComponentsPanel from './ComponentsPanel';
import pic from './Images/ProfilePic.png';
import './Appearence/index.css'
import NavigationBar from "./NavigationBar";

class Profile extends React.Component {

  constructor(props){
    super(props);
    this.state = {
      name: this.props.name,
      position: this.props.position
    };
  }

  render() {
    return (
      <div className = 'profilePage'>
        <div className = 'profileHeader'>
          <h1>Екатерина Яшина</h1>
          <h2>педагог-психолог</h2>
          <NavigationBar/>
          <h1 className = 'name'>{this.state.name}</h1>
          <h2 className = 'position'>{this.state.position}</h2>
          <div className = 'circlePic'>
            <img src = {pic} className = 'profilePic'/>
          </div>
        </div>
        {/*<ComponentsPanel/>*/}
      </div>
    );
  }


}

export default Profile;
